 for any open disputes and complaints. Remember, we are there for YOUR protection. </span></li>\r\n\t\t\t\t\t\t\t\t\t<li><span>No commission, marketing and membership fees are required. An extra payment can occur only at your own will. </span></li>\r\n\t\t\t\t\t\t\t\t\t<li><span>Further to our appreciation to you as a customer and a seller, we have created the Unique Project Work Space where both parties can work and communicate in a safe environment. </span></li>\r\n\t\t\t\t\t\t\t\t\t<li><span>We provide safe and instant transfer of money to any country in the world, available in your own currency.</span></li>\r\n\t\t\t\t\t\t\t\t</ul>\r\n\t\t\t\t\t\t\t\t<div class=\"text-center\">\r\n\t\t\t\t\t\t\t\t\t<a href=\"#signup-popup\" class=\"popup-with-zoom-anim btn-cta--green\">JOIN US TODAY. IT'S FREE</a>\r\n\t\t\t\t\t\t\t\t</div>", mainpage_options: "\t\t\t\t\t\t<div class=\"benefits-ico-title text-center\">Lets work together to Succeed</div>\r\n\t\t\t\t\t\t<div class=\"row\">\r\n\t\t\t\t\t\t\t<div class=\"col-sm-4 text-center\">\r\n\t\t\t\t\t\t\t\t<i class=\"ico ico-benefit-1\"></i>\r\n\t\t\t\t\t\t\t\t<span class=\"ico-benefit-heading\">Outsource your workload </span>\r\n\t\t\t\t\t\t\t\t<span class=\"ico-benefit-description\">No upfront payments will occur until complete satisfaction is met between you and the Seller.</span>\r\n\t\t\t\t\t\t\t</div>\r\n\t\t\t\t\t\t\t<div class=\"col-sm-4 text-center\">\r\n\t\t\t\t\t\t\t\t<i class=\"ico ico-benefit-2\"></i>\r\n\t\t\t\t\t\t\t\t<span class=\"ico-benefit-heading\">Sell your services </span>\r\n\t\t\t\t\t\t\t\t<span class=\"ico-benefit-description\">Use your expertise and experience to help others. Post your service and start selling. Its free, simple and quick.</span>\r\n\t\t\t\t\t\t\t</div>\r\n\t\t\t\t\t\t\t<div class=\"col-sm-4 text-center\">\r\n\t\t\t\t\t\t\t\t<i class=\"ico ico-benefit-3\"></i>\r\n\t\t\t\t\t\t\t\t<span class=\"ico-benefit-heading\">Safe community  </span>\r\n\t\t\t\t\t\t\t\t<span class=\"ico-benefit-de